import 'font-awesome/css/font-awesome.min.css';

 function Ipro_Edge(){
    return(
        <div>
            <h2>2 <h4>THEME</h4></h2>
            <br/><br/><br/>

           <div id="hari" >
          
            <h3 >ipro</h3>
            <h5 >EDGE</h5>
          
            </div>

            <br/>
            <i id="email" class="fa fa-envelope-o" aria-hidden="true"></i>
            <input id="hari2"  type="text" placeholder="___name@gmail.com"/>
            <br/>
            <input type="text" placeholder=""/>
          

        </div>
    )
 }
 export default Ipro_Edge;
